# This is a sample config file. It was tested with:
#
#      Compiler name/version:       [gcc, 4.2 snapshot 20060325]
#      Compiler name/version:       [gcc, 4.2 snapshot 20060617]
#      Operating system version:    [SLES9 SP3 for AMD64]
#      Operating system version:    [SUSE 10.1 for AMD64]
#      Hardware:                    [Opteron]
#
# If your platform uses different versions, different
# hardware or operates in a different mode (for
# example, 32- vs. 64-bit mode), there is the possibiliy
# that this configuration file may not work as-is.
#
# Note that issues with compilation should be directed
# to the compiler vendor. Information about SPEC techncial
# support can be found in the techsupport document in the
# Docs directory of your benchmark installation.
#
# Also note that this is a sample configuration. It
# is expected to work for the environment in which
# it was tested; it is not guaranteed that this is
# the config file that will provide the best performance.
#
# Note that you might find a more recent config file for
# your platform with the posted results at
# www.spec.org/cpu2006
####################################################################
# linux64-amd64-gcc42.cfg
# FSF's gcc 4.2 config file for
# AMD64 64-bit (64 bit binaries on 64 bit host)
# Config file for CPU2006	int and fp Base only
#####################################################################

ignore_errors = yes
tune          = peak
ext           = SanRazor-baseline
output_format = asc, pdf, Screen
reportable    = 1
iterations = 1
ignore_errors = 1
backup_config = 0

teeout        = yes
teerunout     = yes
hw_avail = Dec-9999
license_num = 9999
test_sponsor = Turbo Computers
prepared_by = 
tester      =
test_date = Dec-9999

default=default=default=default:
#####################################################################
#
# Compiler selection
#
#####################################################################
CC           = SanRazor-clang
CXX          = SanRazor-clang++
FC           = /usr/local/sles9/gcc42-0325/bin/gfortran

## HW config
hw_model     = Tyan Thunder KKQS Pro (S4882)
hw_cpu_name  = AMD Opteron 256
hw_cpu_char  =
hw_cpu_mhz   = 3000
hw_fpu       = Integrated
hw_nchips	= 1
hw_ncores	= 1
hw_ncoresperchip= 1
hw_nthreadspercore = 1
hw_ncpuorder = 1 chip
hw_pcache    = 64 KB I + 64 KB D on chip per chip
hw_scache    = 1 MB I+D on chip per chip
hw_tcache    = None
hw_ocache    = None
hw_memory	= 2 GB (2 x 1GB DDR333 CL2.5)
hw_disk		= SATA
hw_vendor	= Tyan

## SW config
sw_os        = SUSE SLES9 (for AMD64)
sw_file      = ext3
sw_state     = runlevel 3
sw_compiler  = gcc , g++ & gfortran 4.2.0325 (for AMD64)
sw_avail = Dec-9999
sw_other = None
sw_auto_parallel = No
sw_base_ptrsize = 64-bit
sw_peak_ptrsize = Not Applicable


#####################################################################
# Optimization
#####################################################################
## Base is low opt
# Default optimization snippets
%define default_optimize              -O3 -fno-omit-frame-pointer
%define asan_optimize                 %{default_optimize} -fsanitize=address 
%define ubsan_optimize                %{default_optimize} -fsanitize=undefined

%define ASAN                          SR_asan_L0,SR_asan_L1,SR_asan_L2,SR_asan_L3,asan
%define UBSAN                         SR_ubsan_L0,SR_ubsan_L1,SR_ubsan_L2,SR_ubsan_L3,ubsan

default=default=default=default:
COPTIMIZE     = -O3
CXXOPTIMIZE  = -O3 
FOPTIMIZE    = -O3

default=default=%{ASAN}:
OPTIMIZE     = %{asan_optimize}
default=default=%{UBSAN}:
OPTIMIZE     = %{ubsan_optimize}

default=default=default=default:
# %define with_SR_state SR_STATE_PATH="\$( pwd | sed -E 's:build([^/]+)\$:state\\1:' )"
%define with_SR_state SR_STATE_PATH="\$(pwd)/Cov"
%define compile_asan_default_options clang -Wall -O3 -o set_asan_default_options.o -c "\$(dirname $[configpath])/../set_asan_default_options/set_asan_default_options.c" -DASAN_DEFAULT_OPTIONS=

fdo_pre_make1 = %{with_SR_state} SanRazor-clang -SR-init
fdo_make_pass1 = specmake -j 1 build FDO=PASS1 %{with_SR_state}

default=default=SR_asan_L0:
fdo_run1 = $command
fdo_pre_make2 = %{with_SR_state} SanRazor-clang -SR-opt -san-level=L0
fdo_make_pass2 = specmake -j 1 build FDO=PASS2 %{with_SR_state}

default=default=SR_asan_L1:
fdo_run1 = $command
fdo_pre_make2 = %{with_SR_state} SanRazor-clang -SR-opt -san-level=L1
fdo_make_pass2 = specmake -j 1 build FDO=PASS2 %{with_SR_state}

default=default=SR_asan_L2:
fdo_run1 = $command
fdo_pre_make2 = %{with_SR_state} SanRazor-clang -SR-opt -san-level=L2
fdo_make_pass2 = specmake -j 1 build FDO=PASS2 %{with_SR_state}

default=default=SR_ubsan_L0:
fdo_run1 = $command
fdo_pre_make2 = %{with_SR_state} SanRazor-clang -SR-opt -san-level=L0
fdo_make_pass2 = specmake -j 1 build FDO=PASS2 %{with_SR_state}

default=default=SR_ubsan_L1:
fdo_run1 = $command
fdo_pre_make2 = %{with_SR_state} SanRazor-clang -SR-opt -san-level=L1
fdo_make_pass2 = specmake -j 1 build FDO=PASS2 %{with_SR_state}

default=default=SR_ubsan_L2:
fdo_run1 = $command
fdo_pre_make2 = %{with_SR_state} SanRazor-clang -SR-opt -san-level=L2
fdo_make_pass2 = specmake -j 1 build FDO=PASS2 %{with_SR_state}


default=default=asan:
fdo_run1 = 
fdo_pre_make2 = %{with_SR_state} SanRazor-clang -SR-san
fdo_make_pass2 = specmake -j 1 build FDO=PASS2 %{with_SR_state}

default=default=ubsan:
fdo_run1 = 
fdo_pre_make2 = %{with_SR_state} SanRazor-clang -SR-san
fdo_make_pass2 = specmake -j 1 build FDO=PASS2 %{with_SR_state}

notes0100= C base flags: $[COPTIMIZE]
notes0110= C++ base flags: $[CXXOPTIMIZE]
notes0120= Fortran base flags: $[FOPTIMIZE]

#####################################################################
# 32/64 bit Portability Flags - all
#####################################################################

default=base=default=default:
notes25= PORTABILITY=-DSPEC_CPU_LP64 is applied to all benchmarks in base.
PORTABILITY = -DSPEC_CPU_LP64

# UBSan relaxations for specific benchmarks
401.bzip2=default=%{UBSAN}:
OPTIMIZE     = %{ubsan_optimize} -fno-sanitize=shift

403.gcc=default=%{UBSAN}:
